import React from 'react';
import { useSelector } from 'react-redux';
import {
    Header,
    LeftOptions,
    RightOptions,
    LinkStyled
} from './navigation.styles'

const Navigation = () => {
    const { comments } = useSelector(state => state.mediaReducer);
    return (
        <Header>
            <LeftOptions>
                <LinkStyled to='/search'>
                    Query
                </LinkStyled>
                <LinkStyled to='/display' disabled={comments.length ? true : false}>
                    Analyze
                </LinkStyled>
            </LeftOptions>
            <RightOptions>
                <LinkStyled to='/about'>
                    About
                </LinkStyled>
            </RightOptions>
        </Header>
    )
}

export default Navigation;
